import axios from 'axios'

const LABORANT_BASE_REST_API_URL = 'http://localhost:8090/api/v1/laborants';

class LaborantService{
    
    getAllLaborants(){
        return axios.get(LABORANT_BASE_REST_API_URL)
    }
}

export default new LaborantService();
